import React from 'react';
import {Link} from 'react-router-dom';

function Home() {
  return (
    <div>
        <div class="card">
            <img src="doc.jpeg" alt="doc"/>
            <div class="card-body">
                <Link to='/schedule'>
                    <button className="btn btn-danger"> Button</button>
                </Link>
            </div>
        </div>

    </div>
  );
}


export default Home;
